from befree.api_model.config.headers import Headersfrom befree.api_model.catalog.public.service.endpoints import Endpointsfrom befree.api_model import apifrom requests import Responseclass Service:    def __init__(self):        self._endpoints = Endpoints()        self._headers = Headers()    def heartbeat(self):        response: Response = api.private_session.get(            url=self._endpoints.heartbeat        )        return response